    [],nt"num_tags": 10,nt"name": "rocky-mountain-arsenal-fish-and-wildlife-management-plan-fiscal-year-1990",nt"isopen":
    false,nt"url": null,nt"notes": "The Rocky Mountain Arsenal National Wildlife
    Refuge Fish and Wildlife Management Plan was prepared to guide U.S. Fish and Wildlife
    Service (Service) study and work activities for fiscal year 1990. This plan reflects
    tasks and goals that are defined both in the Agreement and a Five Year Fish and
    Wildlife Management Plan prepared under the provisions of the Cooperative Agreement
    for Conservation and Management of Fish and Wildlife Resources at Rocky Mountain
    Arsenal. Proposed activities included'in this FY 1990 plan specifically address
    fish and wildlife protection and management efforts, fish and wildlife impact assessment
    and coordination processes, habitat mitigation and enhancement measures, fish and
    wildlife population inventory programs, contaminant program direction, public relation
    activities and proposed law enforcement training needs. Management responsibilities
    of the Service are divided into several operational sections or function, Conservation/Mitigation,
    Contaminants, Public Affairs and Law Enforcement.  The management plan established
    the objectives, methods, and priorities of Service proposed fish wildlife baseline
    population investigations, conservation, and mitigation efforts on the Arsenal.",nt"owner_org":
